import React from "react";
const handleOpen = event => {
    setIsShown(true);
  };
  const handleClose = event => {
    setIsShown(false);
  };
function Ham(){
    return(
        <div>
           <h2 className="absolute" onClick={handleClose} >Some content here</h2>
        </div>
    )

}

export default Ham;
